import React from 'react'
import Jumbotron from 'react-bootstrap/Jumbotron'

const Inputfield = () => {
    return (
        <div className="App">
        <Jumbotron className = "text-center header bg-info">
          <h2 className = "klasse01 p-2 pl-3 pr-3">
            {props.str}
          </h2>
        </Jumbotron>
      </div>
    )
}

export default Inputfield
